const initialValue = {
    data: []
}

const LoginData = (state = initialValue, action) => {
    switch (action.type) {
        case "FetchLoginData":
            return {
                ...state,
                data: { ...state.data, }
            }
        default: return state;
    }
}

console.log(initialValue);

export default LoginData;
